import React from "react";
import styled from "styled-components";

const ListUser = ({ ProfilePicture, Name, Link, Company, Address, Stars }) => (
  <Container>
    <ul>
      <li>
        <div>
          <div className="BoxImgPerfil">
            <img src={ProfilePicture} />
          </div>
          <div className="BoxNome">
            <p>
              {Name}
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="11"
                height="16"
                viewBox="0 0 11 16"
                fill="none"
              >
                <path
                  d="M0.4375 14.125L6.5625 8L0.4375 1.875L2.3125 0L10.3125 8L2.3125 16L0.4375 14.125Z"
                  fill="black"
                />
              </svg>
            </p>
            <p>Conteúdo da página</p>
          </div>
        </div>
        {ProfilePicture} {Name} {Link} {Company} {Address} {Stars}
      </li>
    </ul>
  </Container>
);

const Container = styled.div`
  background-color: black;
  color: #fff;
  width: 85%;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 16px;
  height: 40px;
  border: none;
  border-radius: 40px;
  cursor: pointer;
  box-shadow: 0px 3px 7px gray;
  animation: 0.5s;
  transition: 0.5s;
  transform: scale(1);
  :hover {
    animation: 0.5s;
    transition: 0.5s;
    transform: scale(1.1);
  }
`;

export default ListUser;
